// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Import your CSS file for styling

const Navbar = () => {
  const handleSignUpClick = () => {
    // Logic to show the registration form (e.g., toggle a state)
    // You might need to lift the state up or use context for global state management.
    alert('Sign Up button clicked!'); // Replace with your logic to show registration form
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand">
        <Link to="/">Health&Me</Link>
      </div>
      <div className="navbar-links">
      <Link to="/about-us">HOME</Link>
        <Link to="/about-us">About Us</Link>
        <Link to="/category">Category</Link>
        <Link to="/articles">Articles</Link>
        <Link to="/stories">Stories</Link>
      </div>
      <div className="navbar-actions">
        <Link to="/login">Login</Link>
        <button className="signup-button" onClick={handleSignUpClick}>
          Sign Up
        </button>
        <Link to="/profile">
          <img src="/path/to/profile-icon.png" alt="Profile" className="profile-icon" />
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
